import React from 'react';
import { DataQuality, SeverityContext, AdaptiveThresholds } from '../types/insights';
import { AlertTriangle, TrendingUp, Database, Settings, CheckCircle, XCircle } from 'lucide-react';

interface DriftQualityPanelProps {
  dataQuality: DataQuality;
  severityContext: SeverityContext;
  adaptiveThresholds: AdaptiveThresholds;
}

const DriftQualityPanel: React.FC<DriftQualityPanelProps> = ({ 
  dataQuality, 
  severityContext, 
  adaptiveThresholds 
}) => {
  const formatNumber = (num: number, decimals: number = 0) => {
    return new Intl.NumberFormat('en-US', {
      minimumFractionDigits: decimals,
      maximumFractionDigits: decimals
    }).format(num);
  };

  const formatPercentage = (num: number) => {
    return `${(num * 100).toFixed(1)}%`;
  };

  const getScoreColor = (score: number) => {
    if (score >= 0.8) return 'text-green-600';
    if (score >= 0.6) return 'text-yellow-600';
    return 'text-red-600';
  };

  const getScoreBackground = (score: number) => {
    if (score >= 0.8) return 'bg-green-100 border-green-200';
    if (score >= 0.6) return 'bg-yellow-100 border-yellow-200';
    return 'bg-red-100 border-red-200';
  };

  const renderQualityScore = (score: number, label: string) => (
    <div className={`p-4 rounded-lg border ${getScoreBackground(score)}`}>
      <div className="flex items-center justify-between">
        <span className="text-sm font-medium text-gray-700">{label}</span>
        <span className={`text-lg font-bold ${getScoreColor(score)}`}>
          {score.toFixed(2)}
        </span>
      </div>
    </div>
  );

  return (
    <div className="space-y-6">
      {/* Data Quality Overview */}
      <div className="bg-white border border-gray-200 rounded-lg p-6">
        <div className="flex items-center mb-4">
          <Database className="h-6 w-6 text-blue-600 mr-2" />
          <h3 className="text-lg font-semibold text-gray-900">Data Quality Overview</h3>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4 mb-6">
          <div className="text-center">
            <div className="text-2xl font-bold text-gray-900">{formatNumber(dataQuality.total_logs)}</div>
            <div className="text-sm text-gray-600">Total Logs</div>
          </div>
          <div className="text-center">
            <div className="text-2xl font-bold text-green-600">{formatNumber(dataQuality.valid_logs)}</div>
            <div className="text-sm text-gray-600">Valid Logs</div>
          </div>
          <div className="text-center">
            <div className="text-2xl font-bold text-red-600">{formatNumber(dataQuality.validation_errors)}</div>
            <div className="text-sm text-gray-600">Validation Errors</div>
          </div>
          <div className="text-center">
            <div className={`text-2xl font-bold ${getScoreColor(dataQuality.quality_metrics.overall_score)}`}>
              {dataQuality.quality_metrics.overall_score.toFixed(2)}
            </div>
            <div className="text-sm text-gray-600">Overall Score</div>
          </div>
        </div>

        {/* Quality Component Scores */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          {renderQualityScore(dataQuality.quality_metrics.component_scores.data_quality, 'Data Quality')}
          {renderQualityScore(dataQuality.quality_metrics.component_scores.service_diversity, 'Service Diversity')}
          {renderQualityScore(dataQuality.quality_metrics.component_scores.correlation_significance, 'Correlation Significance')}
          {renderQualityScore(dataQuality.quality_metrics.component_scores.statistical_robustness, 'Statistical Robustness')}
        </div>
      </div>

      {/* Drift Detection */}
      <div className="bg-white border border-gray-200 rounded-lg p-6">
        <div className="flex items-center mb-4">
          <TrendingUp className="h-6 w-6 text-purple-600 mr-2" />
          <h3 className="text-lg font-semibold text-gray-900">Drift Detection</h3>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <div className="flex items-center mb-3">
              {dataQuality.drift_detection.drift_detected ? (
                <XCircle className="h-5 w-5 text-red-600 mr-2" />
              ) : (
                <CheckCircle className="h-5 w-5 text-green-600 mr-2" />
              )}
              <span className="font-medium">
                Drift Status: {dataQuality.drift_detection.drift_detected ? 'Detected' : 'Not Detected'}
              </span>
            </div>

            <div className="space-y-2 text-sm">
              <div>
                <span className="font-medium">Drift Score:</span> {dataQuality.drift_detection.drift_score.toFixed(3)}
              </div>
              <div>
                <span className="font-medium">Drift Type:</span> {dataQuality.drift_detection.drift_type}
              </div>
              <div>
                <span className="font-medium">Confidence:</span> {dataQuality.drift_detection.confidence.toFixed(3)}
              </div>
              <div>
                <span className="font-medium">Historical Patterns:</span> {dataQuality.drift_detection.historical_patterns_count}
              </div>
            </div>
          </div>

          <div>
            <h4 className="font-medium mb-2">Drift Indicators</h4>
            <div className="space-y-1">
              {dataQuality.drift_detection.indicators.map((indicator, index) => (
                <div key={index} className="text-sm bg-gray-50 px-3 py-1 rounded">
                  {indicator}
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {/* Data Characteristics */}
      <div className="bg-white border border-gray-200 rounded-lg p-6">
        <div className="flex items-center mb-4">
          <AlertTriangle className="h-6 w-6 text-orange-600 mr-2" />
          <h3 className="text-lg font-semibold text-gray-900">Data Characteristics</h3>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <div className="space-y-3">
            <h4 className="font-medium text-gray-700">Error Metrics</h4>
            <div className="space-y-2 text-sm">
              <div>
                <span className="font-medium">Error Rate:</span> {formatPercentage(dataQuality.data_characteristics.error_rate)}
              </div>
              <div>
                <span className="font-medium">Service Error Rate:</span> {formatPercentage(severityContext.error_rates.service_error_rate)}
              </div>
              <div>
                <span className="font-medium">Services with Errors:</span> {severityContext.error_rates.services_with_errors} / {severityContext.error_rates.total_services}
              </div>
            </div>
          </div>

          <div className="space-y-3">
            <h4 className="font-medium text-gray-700">Data Structure</h4>
            <div className="space-y-2 text-sm">
              <div>
                <span className="font-medium">Sparsity:</span> {formatPercentage(dataQuality.data_characteristics.sparsity)}
              </div>
              <div>
                <span className="font-medium">Pattern Strength:</span> {dataQuality.data_characteristics.pattern_strength.toFixed(3)}
              </div>
              <div>
                <span className="font-medium">Service Count:</span> {dataQuality.data_characteristics.service_count}
              </div>
            </div>
          </div>

          <div className="space-y-3">
            <h4 className="font-medium text-gray-700">Coverage</h4>
            <div className="space-y-2 text-sm">
              <div>
                <span className="font-medium">Time Coverage:</span> {dataQuality.quality_metrics.data_coverage.time_coverage_hours.toFixed(1)}h
              </div>
              <div>
                <span className="font-medium">Service Diversity:</span> {dataQuality.quality_metrics.data_coverage.service_diversity.toFixed(2)}
              </div>
              <div>
                <span className="font-medium">Avg Logs/Service:</span> {dataQuality.data_characteristics.avg_logs_per_service.toFixed(1)}
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Adaptive Thresholds */}
      <div className="bg-white border border-gray-200 rounded-lg p-6">
        <div className="flex items-center mb-4">
          <Settings className="h-6 w-6 text-gray-600 mr-2" />
          <h3 className="text-lg font-semibold text-gray-900">Adaptive Thresholds</h3>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <h4 className="font-medium mb-3">Detection Thresholds</h4>
            <div className="space-y-2 text-sm">
              <div className="flex justify-between">
                <span>Z-Score Threshold:</span>
                <span className="font-mono">{adaptiveThresholds.z_score_threshold.toFixed(2)}</span>
              </div>
              <div className="flex justify-between">
                <span>Correlation Threshold:</span>
                <span className="font-mono">{adaptiveThresholds.correlation_threshold.toFixed(3)}</span>
              </div>
              <div className="flex justify-between">
                <span>PMI Threshold:</span>
                <span className="font-mono">{adaptiveThresholds.pmi_threshold.toFixed(2)}</span>
              </div>
              <div className="flex justify-between">
                <span>Min Points:</span>
                <span className="font-mono">{adaptiveThresholds.min_points}</span>
              </div>
            </div>
          </div>

          <div>
            <h4 className="font-medium mb-3">Severity Thresholds</h4>
            <div className="space-y-2 text-sm">
              <div className="flex justify-between">
                <span>Critical Threshold:</span>
                <span className="font-mono text-red-600">{severityContext.recommended_thresholds.critical.toFixed(2)}</span>
              </div>
              <div className="flex justify-between">
                <span>High Threshold:</span>
                <span className="font-mono text-orange-600">{severityContext.recommended_thresholds.high.toFixed(2)}</span>
              </div>
            </div>

            <div className="mt-4">
              <h5 className="font-medium mb-2">Context Factors</h5>
              <div className="space-y-1">
                {severityContext.severity_rationale.context_factors.map((factor, index) => (
                  <div key={index} className="text-xs bg-gray-50 px-2 py-1 rounded">
                    {factor}
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Correlation Quality Metrics */}
      <div className="bg-white border border-gray-200 rounded-lg p-6">
        <h3 className="text-lg font-semibold text-gray-900 mb-4">Correlation Quality Metrics</h3>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <div className="text-center">
            <div className="text-xl font-bold text-blue-600">
              {dataQuality.quality_metrics.correlation_quality.significance_rate.toFixed(1)}%
            </div>
            <div className="text-sm text-gray-600">Significance Rate</div>
          </div>
          <div className="text-center">
            <div className="text-xl font-bold text-green-600">
              {dataQuality.quality_metrics.correlation_quality.avg_correlation_strength.toFixed(3)}
            </div>
            <div className="text-sm text-gray-600">Avg Correlation</div>
          </div>
          <div className="text-center">
            <div className="text-xl font-bold text-purple-600">
              {dataQuality.quality_metrics.correlation_quality.avg_pmi_score.toFixed(2)}
            </div>
            <div className="text-sm text-gray-600">Avg PMI Score</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DriftQualityPanel;
